import React from "react";
import { Button, Grid, Paper, TextField } from "@mui/material";

export default function NewGroupForm({ db }) {
  const addGroup = () => {
    try {
      db.add({
        name: "Test Group",
        count: [2, 3, 4, 1, 5, 6, 3, 3, 5],
        next: 4,
      }).then(
        (resp) => {
          console.log(resp);
        },
        (error) => {
          throw new Error(error.target.error);
        }
      );
    } catch (error) {
      console.error(error);
    }
  };
  return (
    <Paper
      elevation={3}
      sx={{ width: "800px", maxWidth: "90vw", margin: "0 auto" }}
    >
      <Grid container justifyContent="space-evenly">
        <Grid item>
          <TextField type="text" label="Group Name" />
        </Grid>
        <Grid item>
          <TextField type="number" label="Min Number" />
        </Grid>
        <Grid item>
          <TextField type="number" label="Count" />
        </Grid>
        <Grid item>
          <Button variant="contained" size="large" onClick={addGroup}>
            Add Group
          </Button>
        </Grid>
      </Grid>
    </Paper>
  );
}
